window.bookSummaryJSON = "MaryJanice Davidson's cult hit <i>Undead and </i> <p><i>Unwed</i> is a delightful mixture of <i>Sex and the City</i> and <i>Buffy the Vampire Slayer</i>.</p> <p>Waking up in a tacky coffin and wearing off-brand shoes, Betsy Taylor can't believe the horrible turn her life has taken; then she discovers she's a vampire. Soon, Betsy becomes a participant in a power struggle between the forces of darkness. With only her friend Jessica and the hunky vampire Sinclair to help her, this new \"Queen of Vampires\" will have a tough time getting her afterlife straight.</p>"; 
